const InfluencerFinder = () => {

    return (
        <div className="App">
        <nav className="navbar navbar-light">
          <a className="navbar-brand" href="/">
            <img src={logo} width="30" height="30" className="d-inline-block align-top" alt=""/>
            Myntra Influencer
          </a>
          
        </nav>
      </div>
    );
}

export default InfluencerFinder;
